COMPONENT.script:
/* ** ScreenCapture */ Required components: none Required included applications: none Other requirements: none
Demo: w4gldev rundbapp remotehost::or62demos d201504_screencapturetool -cscreencapture
Drag the capture window to the location to be captured Resize (and reposition) the capture window until it displays the exact area to be captured Click the Capture button The captured area appears as a thumbnail in the frame Click the Save as … button The File Save dialog appears Choose or enter a folder and a “bmp” frame name to write the captured image out as, and click Save The image is written to file, and the File Save dialog disappears RightClick the Save as … button The image from the file is displayed in the centre of the screen Note that the file image is identical to the captured area (except that that may be greyed, depending on the utility displaying the file image)

initialize()=
declare
	capture			= BitmapObject;
	reply			= StringObject;
	status			= integer not null default ER_OK;
	frame			= FrameExec default null;
	w0				= integer not null default 0;
	h0				= integer not null default 0;
	borderwidth		= integer not null default 9;
	titleheight		= integer not null default 27;
	pixeldensity	= float8 not null default 0.096;
enddeclare
{
	field(thumbnail).NullImageText = '';
	field(thumbnail).GetAttribute(height=Byref(h0), width=Byref(w0));
	frame = openframe CaptureWindow;
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**  Capture the screen area revealed by the capture window
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
*/
on click capturebtn =
declare
	x		= integer not null;
	y		= integer not null;
	w		= integer not null;
	h		= integer not null;
	fw		= integer not null;
	fh		= integer not null;
enddeclare
{
	/*
	**  Compute the enclosed screen area and capture it
	*/
	frame.GetAttribute(
		WindowXLeft=Byref(x), WindowYTop=Byref(y),
		WindowWidth=Byref(w), WindowHeight=Byref(h));

	x = (x*pixeldensity+0.5) + borderwidth;
	y = (y*pixeldensity+0.5) + titleheight;
	w = (w*pixeldensity+0.5);
	h = (h*pixeldensity+0.5);

	capture.CaptureBitmap(windowhandle=0, xstart=x, ystart=y, width=w, height=h);

	/*
	**  Display it as a thumbnail so we can check it is OK
	*/
	field(thumbnail).SetAttribute(height=h0, width=w0);

	if frame.WindowWidth > frame.WindowHeight then
		fw = w0*pixeldensity;
		fh = (pixeldensity*w0*h)/w;
	else
		fw = (h0*w*pixeldensity)/h;
		fh = h0*pixeldensity;
	endif;
	thumbnail = capture.ResizeBitmap(width=fw, height=fh);

	field(thumbnail).DisplayPolicy = DP_AUTOSIZE_FIELD;
	field(thumbnail).UpdField();
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Write the captured image to file
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
*/
on click savebtn =
{
	status = curframe.FilePopup(reply=reply);
	if status = PU_OK then
		capture.WriteToFile(filename=reply.Value, format=BF_BMP);
	endif;
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Demo-only: display the image from the file
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
*/
on properties savebtn =
{
	cursession.ProcessWindow = FALSE;
	call system 'start ' + :reply.Value;
}

